import React from 'react';
import './navbar.css';

function Navbar() {
  return (
    <>
      <div className='navbar-wrapper'>
        <div className='section-container'>
          <div className='profile-photo-container' />
          <button className='item' />
        </div>
        <button className='item' />
      </div>
    </>
  );
}

export default Navbar;
